In order to reference entity types from annother subgraph, a developer would first import these types from the other subgraph's schema. Types can be imported either from a subgraph name or from a subgraph ID. Importing from a subgraph name means that the exact version of the imported subgraph will be identified at query time and its schema may change in arbitrary ways over time. Importing from a subgraph ID guarantees that the schema will never change but also means that the import points to a subgraph version that may become outdated over time. Let's say a DAO subgraph contains a Proposal type that has a proposer field that should link to an Ethereum address (think: Ethereum accounts or contracts) and a transaction field that should link to an Ethereum transaction. The developer would then write the DAO subgraph schema as follows: type _Schema_ @import( types: ["Address", { name: "Transaction", as: "EthereumTransaction" }], from: { name: "ethereum/mainnet" } ) type Proposal @entity { id: ID! proposer: Address! transaction: EthereumTransaction!
} This would then allow queries that follow the references to addresses and transactions, like { proposals { proposer { balance address } transaction { hash block { number } } }
}

