Extending types from another subgraph involves several steps: Importing the entity types from the other subgraph. Extending these types with custom fields. Managing (e.g. creating) extended entities in subgraph mappings. Let's say the DAO subgraph wants to extend the Ethereum Address type to include the proposals created by each respective account. To achieve this, the developer would write the following schema: type _Schema_ @import( types: ["Address"], from: { name: "ethereum/mainnet" } ) type Proposal @entity { id: ID! proposer: Address!
} extend type Address { proposals: [Proposal!]! @derivedFrom(field: "proposal")
} This makes queries like the following possible, where the query can go "back" from addresses to proposal entities, despite the Ethereum Address type originally being defined in the ethereum/mainnet subgraph. { addresses { id proposals { id proposer { id } }
} In the above case, the proposals field on the extended type is derived, which means that an implementation wouldn't have to create a local extension type in the store. However, if proposals was defined as extend type Address { proposals: [Proposal!]!
} then it would the subgraph mappings would have to create partial Address entities with id and proposals fields for all addresses from which proposals were created. At query time, these entity instances would have to be merged with the original Address entities from the ethereum/mainnet subgraph.

