Subgraph composition also supports interfaces in the ways outlined below. Interfaces Can Be Imported From Other Subgraphs The syntax for this is the same as that for importing types: type _Schema_ @import(types: ["ERC20"], from: { name: "graphprotocol/erc20" }) Local Types Can Implement Imported Interfaces This is achieved by importing the interface from another subgraph schema and implementing it in entity types: type _Schema_ @import(types: ["ERC20"], from: { name: "graphprotocol/erc20" }) type MyToken implements ERC20 @entity { # ...
} Imported Types Can Be Extended To Implement Local Interfaces This is achieved by importing the types from another subgraph schema, defining a local interface and using extend to implement the interface on the imported types: type _Schema_ @import(types: [{ name: "Token", as "LPT" }], from: { name: "livepeer/livepeer" }) @import(types: [{ name: "Token", as "Rep" }], from: { name: "augur/augur" }) interface Token { id: ID! balance: BigInt!
} extend LPT implements Token { # ...
}
extend Rep implements Token { # ...
} Imported Types Can Be Extended To Implement Imported Interfaces This is a combination of importing an interface, importing the types and extending them to implement the interface: type _Schema_ @import(types: ["Token"], from: { name: "graphprotocol/token" }) @import(types: [{ name: "Token", as "LPT" }], from: { name: "livepeer/livepeer" }) @import(types: [{ name: "Token", as "Rep" }], from: { name: "augur/augur" }) extend LPT implements Token { # ...
}
extend Rep implements Token { # ...
} Implementation Concerns For Interface Support Querying across types from different subgraphs that implement the same interface may require a smart algorithm, especially when it comes to pagination. For instance, if the first 1000 entities for an interface are queried, this range of 1000 entities may be divided up between different local and imported types arbitrarily. A naive algorithm could request 1000 entities from each subgraph, applying the selected filters and order, combine the results and cut off everything after the first 1000 items. This would generate a minimum of requests but would involve significant overfetching. Another algorithm could just fetch the first item from each subgraph, then based on that information, divide up the range in more optimal ways than the previous algorith, and satisfy the query with more requests but with less overfetching.

