The mutations schema defines all of the mutations in the subgraph. The mutations schema builds on the subgraph schema, allowing the use of types from the subgraph schema, as well as defining new types that are used only in the context of mutations. For example, starting from a base subgraph schema: schema.graphql type MyEntity @entity { id: ID! name: String! value: BigInt!
} Developers can define mutations that reference these subgraph schema types. Additionally new input and interface types can be defined for the mutations to use: mutations/schema.graphql input MyEntityOptions { name: String! value: BigInt!
} interface NewNameSet { oldName: String! newName: String!
} type Mutation { createEntity( options: MyEntityOptions! ): MyEntity! setEntityName( entity: MyEntity! name: String! ): NewNameSet!
} graph-cli handles the parsing and validating of these two schemas. It verifies that the mutations schema defines a type Mutation and that all of the mutations within it are defined in the resolvers module (see next section).

