Each mutation within the schema must have a corresponding resolver function defined. Resolvers will be invoked by whatever engine executes the mutation queries (ex: Apollo Client). They are executed locally within the client application. Mutation resolvers of kind javascript/es5 take the form of an ES5 javascript module. This module is expected to have a default export that contains the following properties: resolvers: MutationResolvers - The mutation resolver functions. The shape of this object must match the shape of the type Mutation defined above. See the example below for demonstration of this. Resolvers have the following prototype, as defined in graphql-js : import { GraphQLFieldResolver } from 'graphql' interface MutationContext< TConfig extends ConfigGenerators, TState, TEventMap extends EventTypeMap
> { [prop: string]: any, graph: { config: ConfigProperties<TConfig>, dataSources: DataSources, state: StateUpdater<TState, TEventMap> }
} interface MutationResolvers< TConfig extends ConfigGenerators, TState, TEventMap extends EventTypeMap
> { Mutation: { [field: string]: GraphQLFieldResolver< any, MutationContext<TConfig, TState, TEventMap> > }
} config: ConfigGenerators - A collection of config generators. The config object is made up of properties, that can be nested, but all terminate in the form of a function with the prototype: type ConfigGenerator<TArg, TRet> = (arg: TArg) => TRet interface ConfigGenerators { [prop: string]: ConfigGenerator<any, any> | ConfigGenerators
} See the example below for a demonstration of this. stateBuilder: StateBuilder (optional) - A state builder interface responsible for (1) initializing extended state properties and (2) reducing extended state events. State builders implement the following interface: type MutationState<TState> = CoreState & TState
type MutationEvents<TEventMap> = CoreEvents & TEventMap interface StateBuilder<TState, TEventMap extends EventTypeMap> { getInitialState(uuid: string): TState, // Event Specific Reducers reducers?: { [TEvent in keyof MutationEvents<TEventMap>]?: ( state: MutationState<TState>, payload: InferEventPayload<TEvent, TEventMap> ) => OptionalAsync<Partial<MutationState<TState>>> }, // Catch-All Reducer reducer?: ( state: MutationState<TState>, event: Event ) => OptionalAsync<Partial<MutationState<TState>>>
} interface EventPayload { } interface Event { name: string payload: EventPayload
} interface EventTypeMap { [name: string]: EventPayload
} // Optionally support async functions
type OptionalAsync<T> = Promise<T> | T // Infer the payload type from the event name, given an EventTypeMap
type InferEventPayload< TEvent extends keyof TEvents, TEvents extends EventTypeMap
> = TEvent extends keyof TEvents ? TEvents[TEvent] : any See the example below for a demonstration of this. For example: mutations/index.js import { Event, EventPayload, MutationContext, MutationResolvers, MutationState, StateBuilder, ProgressUpdateEvent
} from "@graphprotocol/mutations" import gql from "graphql-tag"
import { ethers } from "ethers"
import { AsyncSendable, Web3Provider
} from "ethers/providers"
import IPFS from "ipfs" // Typesafe Context
type Context = MutationContext<Config, State, EventMap> /// Mutation Resolvers
const resolvers: MutationResolvers<Config, State, EventMap> = { Mutation: { async createEntity (source: any, args: any, context: Context) { // Extract mutation arguments const { name, value } = args.options // Use config properties created by the // config generator functions const { ethereum, ipfs } = context.graph.config // Create ethereum transactions... // Fetch & upload to ipfs... // Dispatch a state event through the state updater const { state } = context.graph await state.dispatch("PROGRESS_UPDATE", { progress: 0.5 }) // Dispatch a custom extended event await state.dispatch("MY_EVENT", { myValue: "..." }) // Get a copy of the current state const currentState = state.current // Send another query using the same client. // This query would result in the graph-node's // entity store being fetched from. You could also // execute another mutation here if desired. const { client } = context await client.query({ query: gql` myEntity (id: "${id}") { id name value } }` }) ... }, async setEntityName (source: any, args: any, context: Context) { ... } }
} /// Config Generators
type Config = typeof config const config = { // These function arguments are passed in by the dApp ethereum: (arg: AsyncSendable): Web3Provider => { return new ethers.providers.Web3Provider(arg) }, ipfs: (arg: string): IPFS => { return new IPFS(arg) }, // Example of a custom config property property: { // Generators can be nested a: (arg: string) => { }, b: (arg: string) => { } }
} /// (optional) Extended State, Events, and State Builder // Extended State
interface State { myValue: string
} // Extended Events
interface MyEvent extends EventPayload { myValue: string
} type EventMap = { "MY_EVENT": MyEvent
} // Extended State Builder
const stateBuilder: StateBuilder<State, EventMap> = { getInitialState(): State { return { myValue: "" } }, reducers: { "MY_EVENT": async (state: MutationState<State>, payload: MyEvent) => { return { myValue: payload.myValue } }, "PROGRESS_UPDATE": (state: MutationState<State>, payload: ProgressUpdateEvent) => { // Do something custom... } }, // Catch-all reducer... reducer: (state: MutationState<State>, event: Event) => { switch (event.name) { case "TRANSACTION_CREATED": // Do something custom... break } }
} export default { resolvers, config, stateBuilder
} // Required Types
export { Config, State, EventMap, MyEvent
