> { mutations: MutationsModule<TConfig, TState, TEventMap>, subgraph: string, node: string, config: ConfigArguments<TConfig> mutationExecutor?: MutationExecutor<TConfig, TState, TEventMap>
} interface Mutations< TConfig extends ConfigGenerators, TState, TEventMap extends EventTypeMap
> { execute: (query: MutationQuery<TConfig, TState, TEventMap>) => Promise<MutationResult> configure: (config: ConfigArguments<TConfig>) => void
} const createMutations = < TConfig extends ConfigGenerators, TState = CoreState, TEventMap extends EventTypeMap = { },
>( options: CreateMutationsOptions<TConfig, TState, TEventMap>
): Mutations<TConfig, TState, TEventMap> => { ... } createMutationsLink - wrap the mutations created above in an ApolloLink. const createMutationsLink = < TConfig extends ConfigGenerators, TState, TEventMap extends EventTypeMap,
> ( { mutations }: { mutations: Mutations<TConfig, TState, TEventMap> }
): ApolloLink => { ... } For applications using Apollo and React, a run-time API is available which mimics commonly used hooks and components for executing mutations, with the addition of having the mutation state available to the caller. This package is called @graphprotocol/mutations-apollo-react and is defined like so: useMutation - see https://www.apollographql.com/docs/react/data/mutations/#executing-a-mutation import { DocumentNode } from "graphql"
