} from "@apollo/react-common"
import { MutationHookOptions } from "@apollo/react-hooks"
import { CoreState } from "@graphprotocol/mutations" type MutationStates<TState> = { [mutation: string]: MutationState<TState>
} interface MutationResultWithState<TState, TData = any> extends MutationResult<TData> { state: MutationStates<TState>
} type MutationTupleWithState<TState, TData, TVariables> = [ ( options?: MutationFunctionOptions<TData, TVariables> ) => Promise<ExecutionResult<TData>>, MutationResultWithState<TState, TData>
] const useMutation = < TState = CoreState, TData = any, TVariables = OperationVariables
>( mutation: DocumentNode, mutationOptions: MutationHookOptions<TData, TVariables>
): MutationTupleWithState<TState, TData, TVariables> => { ... } Mutation - see https://www.howtographql.com/react-apollo/3-mutations-creating-links/ interface MutationComponentOptionsWithState< TState, TData, TVariables
> extends BaseMutationOptions<TData, TVariables> { mutation: DocumentNode children: ( mutateFunction: MutationFunction<TData, TVariables>, result: MutationResultWithState<TState, TData> ) => JSX.Element | null
} const Mutation = < TState = CoreState, TData = any, TVariables = OperationVariables
>( props: MutationComponentOptionsWithState<TState, TData, TVariables>
): JSX.Element | null => { ... } For example: dApp/src/App.tsx import { createMutations, createMutationsLink
} from "@graphprotocol/mutations"
