The implementation introduces the following trait, which is implemented primarily by Store. use std::ops::RangeInclusive;
struct TracesInRange { range: RangeInclusive<u64>, traces: Vec<Trace>,
} pub trait EthereumTraceCache: Send + Sync + 'static { /// Attempts to retrieve traces from the cache. Returns ranges which were retrieved. /// The results may not cover the entire range of blocks. It is up to the caller to decide /// what to do with ranges of blocks that are not cached. fn traces_for_blocks(contract_address: Option<H160>, blocks: RangeInclusive<u64> ) -> Box<dyn Future<Output=Result<Vec<TracesInRange>, Error>>>; fn add(contract_address: Option<H160>, traces: Vec<TracesInRange>);
} Block schema Each cached block will exist as its own row in the database in an eth_traces_cache table. eth_traces_cache(id) { id -> Integer, network -> Text, block_number: Integer, contract_address: Bytea, traces -> Jsonb,
} A multi-column index will be added on network, block_number, and contract_address. It can be noted that in the eth_traces_cache table, there is a very low cardinality for the value of the network row. It is inefficient for example to store the string mainnet millions of times and consider this value when querying. A data oriented approach would be to partition these tables on the value of the network. It is expected that hash partitioning available in Postgres 11 would be useful here, but the necessary dependencies won't be ready in time for this RFC. This may be revisited in the future. Valid Cache Range Because the absence of trace data for a block is a valid cache result, the database must maintain a data structure indicating which ranges of the cache are valid in an eth_traces_meta table. This table also enables eventually implementing cleaning out old data. This is the schema for that structure: id -> Integer,
network -> Text,
start_block -> Integer,
end_block -> Integer,
contract_address -> Nullable<Bytea>,
accessed_at -> Date, When inserting data into the cache, removing data from the cache, or reading the cache, a serialized transaction must be used to preserve atomicity between the valid cache range structure and the cached blocks. Care must be taken to not rely on any data read outside of the serialized transaction, and for the extent of the serialized transaction to not span any async contexts that rely on any Future outside of the database itself. The definition of the EthereumTraceCache trait is designed to uphold these guarantees. In order to preserve space in the database, whenever the valid cache range is added it will be added such that adjacent and overlapping ranges are merged into it.
